import React from 'react';
import './card-list.styles.css';
import {Card} from './card-list/card.component'

export const CardList = props =>{
    return (
        <div className="card-list" >
          { props.monsters.map((monster,index) =>{
            return (
              <div id={monster.id} >
                {monster.name}
              </div>
            )
          })}
        </div>
    )
}
